import React from "react";

const ImageHoverZoom = ({ meinFoto }) => {
  return (
    <div className="img-wrapper fotoDavid">
      <img src={meinFoto} alt="" className="hover-zoom" />
    </div>
  );
};
export default ImageHoverZoom;
